PIX É TOTALMENTE GRATUITO?

Não existem taxas para utilização, caso você seja pessoa física.

Entretanto, os Microempreendedores Individuais (MEIs) e Pessoas Jurídicas (PJ) podem ter que pagar uma taxa em alguns casos.

Para MEIs, a conta não pode ser considerada comercial. Em relação aos PJs, a condição depende da instituição financeira. Alguns tipos de taxações estão expostos abaixo:

* MEI que recebe mais de 30 transações via Pix por mês;
* Receber pagamento por QR Code dinâmico;
* Receber Pix por QR Code estático, ou dinâmico, de um pagador que seja PJ;
* Receber transação em uma conta utilizada exclusivamente para fins comerciais.

